  constructor(props) {
    super(props)

  }

  render() {
    console.log("Props are: ");
    console.log(this.props);
    const answer1  = this.props.answers[0].text
    const answer2  = this.props.answers[1].text
    const answer3  = this.props.answers[2].text;
    const answer4  = this.props.answers[3].text;



    // const answer2 = this.props.answers?[1]?.text
    // const answer3 = this.props.answers?[2]?.text
    // const answer4 = this.props.answers?[3]?.text



    return <Grid container spacing={2}>

      <Grid minicontainer spacing={1}>
        <Button>{answer1} </Button>
        <Button>{answer2}</Button>
      </Grid>

      <Grid minicontainer spacing={1}>
        <Button>{answer3} </Button>
        <Button>{answer4}</Button>
      </Grid>


    </Grid>


  }
}
export default AnswersComponent;
